export class IrmCoeur {

    IrmcoeurId:number;
    PatientId:number;
    DateIrm:string;
    Ct2:number;
    ConcentrationMyocardiaque:number;
    Cr2:number;

    constructor()
    {

        this.IrmcoeurId=0;
        this.PatientId=0;
        this.DateIrm='';
        this.Ct2=0;
        this.ConcentrationMyocardiaque=0;
        this.Cr2=0;
    }
}
